module Show_nat =
 struct
  (** val string_of_base10_digit : int sig0 -> char list **)

  let string_of_base10_digit = function
  | Exist _n ->
    ((fun fO fS n -> if n=0 then fO () else fS (n-1))
       (fun _ -> '0'::[])
       (fun n1 ->
       (fun fO fS n -> if n=0 then fO () else fS (n-1))
         (fun _ -> '1'::[])
         (fun n2 ->
         (fun fO fS n -> if n=0 then fO () else fS (n-1))
           (fun _ -> '2'::[])
           (fun n3 ->
           (fun fO fS n -> if n=0 then fO () else fS (n-1))
             (fun _ -> '3'::[])
             (fun n4 ->
             (fun fO fS n -> if n=0 then fO () else fS (n-1))
               (fun _ -> '4'::[])
               (fun n5 ->
               (fun fO fS n -> if n=0 then fO () else fS (n-1))
                 (fun _ -> '5'::[])
                 (fun n6 ->
                 (fun fO fS n -> if n=0 then fO () else fS (n-1))
                   (fun _ -> '6'::[])
                   (fun n7 ->
                   (fun fO fS n -> if n=0 then fO () else fS (n-1))
                     (fun _ -> '7'::[])
                     (fun n8 ->
                     (fun fO fS n -> if n=0 then fO () else fS (n-1))
                       (fun _ -> '8'::[])
                       (fun n9 ->
                       (fun fO fS n -> if n=0 then fO () else fS (n-1))
                         (fun _ -> '9'::[])
                         (fun _ -> assert false (* absurd case *))
                         n9)
                       n8)
                     n7)
                   n6)
                 n5)
               n4)
             n3)
           n2)
         n1)
       _n)

  (** val string_of_nat_rec : int -> int -> char list **)

  let rec string_of_nat_rec fuel n0 =
    (fun fO fS n -> if n=0 then fO () else fS (n-1))
      (fun _ -> [])
      (fun fuel0 ->
      if (<) n0 (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
           (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
           (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
           (Stdlib.Int.succ 0))))))))))
      then string_of_base10_digit (Exist n0)
      else append
             (string_of_nat_rec fuel0
               (Nat.div n0 (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
                 (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
                 (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
                 (Stdlib.Int.succ 0))))))))))))
             (string_of_nat_rec fuel0
               (Nat.modulo n0 (Stdlib.Int.succ (Stdlib.Int.succ
                 (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
                 (Stdlib.Int.succ (Stdlib.Int.succ (Stdlib.Int.succ
                 (Stdlib.Int.succ (Stdlib.Int.succ 0)))))))))))))
      fuel

  (** val string_of_nat : int -> char list **)

  let string_of_nat n0 =
    string_of_nat_rec (Stdlib.Int.succ n0) n0
 end

