(** val list_nth : 'a1 list -> index -> 'a1 **)

let rec list_nth l idx =
  match l with
  | [] -> assert false (* absurd case *)
  | k :: l0 ->
    ((fun fthisone fanotherone n -> if n = 0 then fthisone () else fanotherone (n - 1))
       (fun _ -> k)
       (fun a -> list_nth l0 a)
       (Obj.magic idx))

